import { NavLink } from "react-router-dom";
import "./Navbar.css";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import Container from "react-bootstrap/Container";

const NavMenu = () => {
  return (
    /*         <nav className="topNav">
            <ul>
                <li><NavLink activeClassName={activeClass} to="/" exact>Home</NavLink></li>
                <li><NavLink activeClassName={activeClass} to="/nutrition-analysis">Nutrition analysis</NavLink></li>
                <li><NavLink activeClassName={activeClass} to="/recipes">Recipes</NavLink></li>
                <li><NavLink activeClassName={activeClass} to="/bmi">BMI</NavLink></li>
                <li><NavLink activeClassName={activeClass} to="/articles">Articles</NavLink></li>
                <li><NavLink activeClassName={activeClass} to="/sign-up">Sign up</NavLink></li>
                <li><NavLink activeClassName={activeClass} to="/sign-in">Sign in</NavLink></li>
            </ul>
        </nav> */

    <div className="container">
      <Navbar bg="primary" variant="dark">

          <Nav variant="pills" defaultActiveKey="/home">
            <Nav.Item>
              <Nav.Link href="/home">Active</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link eventKey="link-1">Option 2</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link eventKey="disabled" disabled>
                Disabled
              </Nav.Link>
            </Nav.Item>
          </Nav>

      </Navbar>
    </div>
  );
};

export default NavMenu;
